import {assoc} from 'ramda';

export const signUpUser = user => {
    try {
        return fetch('http://localhost:3000/api/signup', {
            method:'POST',
            mode: 'cors',
            cache: "no-cache",
            url: 'http://localhost:3000',
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify(assoc('roles', ['user'], user))
        })
    } catch(err) {
        throw Error(err);
    }
}

export const logInUser = user => {
    console.log(user)
    try {
        return fetch('http://localhost:3000/api/login', {
            method:'POST',
            mode: 'cors',
            cache: "no-cache",
            url: 'http://localhost:3000',
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify(user)
        })
    } catch(err) {
        throw Error(err);
    }
}


export const loadUserMeals = user => {
    try {
        return fetch('http://localhost:3000/api/meals', {
            method:'GET',
            mode: 'cors',
            cache: "no-cache",
            url: 'http://localhost:3000',
            headers: {
                "Content-Type": "application/json",
                "Authorization": sessionStorage.getItem('jwt')
            },
        })
    } catch(err) {
        throw Error(err);
    }
}
